import Logo from './components/logo/logo';
import Searchbar from './components/searchbar/searchbar';
import './App.css';
import Face from './components/face/face'
import Particles from 'react-particles-js';
import reactDom from 'react-dom';


class App extends React.Component{
  constructor(){
    super();
    this.state={
    input:'',
    imageurl:''
    }
  }
  inpchange=(event)=>{
   this.setState={input:event.target.value};
  }
  onbtnclk=(event)=>{
this.setState={imageurl}
  }
  render(){
  return (
    <div>
      <Particles className='particles'
              params={{
            		particles: {
                  number:{
                    value:200,
                  }
            		}
            	}}
            />
      <Logo/>
      <div style={{display:'flex',justifyContent:'center'}}>
    <div style={{display:'flex',flexDirection:'column'}}>
    <p style={{fontStyle:'oblique',fontSize:'1.5em',justifyContent:'center',paddingBottom:'0px',marginBottom:'2px'}} className='grow'>FACE DETECTION APP :)</p>
    <div style={{marginBottom:'10px',paddingRight:'50px'}}>
    <div style={{border:'2px solid black'}}></div>
    </div>
    <div className='pa4 dib shadow-4 br3 custom'>
      <Searchbar inpchange={this.inpchange} onbtnclk={this.onbtnclk}/>
      <Face />
      </div>
    </div>
    </div>
    </div>
  );
}
}

export default App;
